const statusFilter = [{
    key: 'Confirmed',
    value: 'CONFIRMED'
},{
    key: 'Seated',
    value: 'SEATED'
},{
    key: 'Checked Out',
    value: 'CHECKED OUT'
},{
    key: 'Not Confirmed',
    value: 'NOT CONFIRMED'
}];

export { statusFilter};
